import React from 'react';
import './Cards.css';
import award from '../Images/award.png';
import stylee from '.stylee.jsx'

const Cards = ({ ID }) => {
  switch (ID) {
    case 1:
      return (
        <div className='card'>
          <div className='cardEllipse'>
            <img src={award} alt='img.png' />
          </div>
          <div className='cardContent'>
            <h2>Top Quality</h2>
            <p>Make stuff actually buy, create beautiful, retail-ready custom products withcthe same QC standards as leading fashion brands</p>
          </div>
        </div>
      );
      case 2:
      return (
        <div className='card'>
          <div className='cardEllipse'>
            <img src={award} alt='img.png' />
          </div>
          <div className='cardContent'>
            <h2>Unlimited Customization</h2>
            <p>Let your imagination run wild. We create every product from scratch so you can customize every last detail.</p>
          </div>
        </div>
      );
      case 3:
      return (
        <div className='card'>
          <div className='cardEllipse'>
            <img src={award} alt='img.png' />
          </div>
          <div className='cardContent'>
            <h2>Low minimums</h2>
            <p>Your card content goes here.</p>
          </div>
        </div>
      );
      case 4:
      return (
        <div className='card'>
          <div className='cardEllipse'>
            <img src={award} alt='img.png' />
          </div>
          <div className='cardContent'>
            <h2>Your Card Title</h2>
            <p>Your card content goes here.</p>
          </div>
        </div>
      );
    default:
      return null;
  }
};

export default Cards;
